import React, { useState } from "react";
import style from "../sass/Main.module.scss";
import line from "../images/divider.png";

export default function Main() {
  return (
    <div className={style.about}>
      <p className={style.aboutTitle}>15 Years of excellence</p>
      <img className={style.divider} src={line} alt="divider" />
      <p className={style.aboutContent}>
        We are a fox valley based, down to earth service commited to excellence.
        Our dedication to craftsmanship promises the attention your property
        deserves
      </p>
    </div>
  );
}
